import React from 'react';
import './App.css';

function App() {

  listDogs = () => {

    fetch("http://localhost:3000/pups")
    .then(resp => resp.json())
    .then(dogs => {
      console.log(dogs)
    })
  }

render()
  return (
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">
       {this.listDogs}
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
  );
}

export default App;
